import { Component } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import {BucketService} from "../objects/services";
@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
})
export class AppComponent {
  constructor(private http: HttpClient) {}

  listBuckets() {
    this.http.get('http://localhost:8080/listBuckets').subscribe(response => {
      console.log(response);
    });
  }
  createBucket(bucketName: string) {
    this.http.post('/createBucket', { bucketName }).subscribe(response => {
      console.log(response);
    });
  }

  deleteBucket(bucketName: string) {
    this.http.post('/deleteBucket', { bucketName }).subscribe(response => {
      console.log(response);
    });
  }
}

<ul>
  <li *ngFor="let bucket of buckets">{{ bucket }}</li>
</ul>

<input [(ngModel)]="bucketName" placeholder="Bucket name" />
<button (click)="createBucket()">Create bucket</button>
<button (click)="deleteBucket()">Delete bucket</button>
